import React from 'react'
import Header from '../../components/Header'

/**
 * Represents the component displayed when launching the application.
 * @returns {JSX.Element}
 */
const Home = () => {
    return (
        <div>
            <Header/>
        </div>
    )
}

/**
 * Represents the component displayed when launching the application.
 * @returns {JSX.Element}
 */
export default Home
